import React from 'react';
import axisos from 'axios';

class App extends React.Component {
  state = {
    details: [],
  }

  componentDidMount() {
    let data;
    axisos.get('http://localhost:8000/employee/')
      .then(res => 
        {
          data = res.data;
          this.setState({details: data});
        })
      .catch(err => console.log(err));
  }

  render() {
    return (
      <div>
        <h1>{this.state.message}</h1>
      </div>
    );
  }
}

export default App;
